type BackwardCompatibleOmit<T, K extends keyof any> = Pick<T, Exclude<keyof T, K>>;

export interface IconProps
  extends BackwardCompatibleOmit<DOMAttributes<SVGSVGElement>, 'children' | 'mask'> {
  size?: 'sm' | 'lg';
  color?: string;
  style?: CSSProperties;
  className?: string;
}

export interface IconWrapperProps extends IconProps {
  icon: AvailableIcons;
}

export const IconStyled = styled.svg<IconProps>`
  display: inline-block;
  height: 1em;
  ${({ size }) => {
    switch (size) {
      case 'sm':
        return css`
          line-height: 1.33333em;
          vertical-align: -0.125em;
          font-size: 0.75em;
        `;
      case 'lg':
        return css`
          line-height: 0.75em;
          vertical-align: -0.225em;
          font-size: 1.33333em;
        `;
      default:
        return css`
          vertical-align: -0.125em;
          font-size: 1em;
        `;
    }
  }}
  ${({ color }) => {
    if (!color) return css``;
    else
      return css`
        color: ${color};
        fill: ${color};
      `;
  }}
`;

